// @mui material components
import Container from "@mui/material/Container";
import Grid from "@mui/material/Grid";

// Material Kit 2 React components
import MKBox from "components/MKBox";
import MKTypography from "components/MKTypography";

// Material Kit 2 React examples
import HorizontalTeamCard from "examples/Cards/TeamCards/HorizontalTeamCard";
import PublicIcon from "@mui/icons-material/Public";

import {
  Card,
  CardContent,
  Typography,
  CardActions,
  Button,
  CardHeader,
  CardMedia,
  Icon,
} from "@mui/material";

// Images
import team1 from "assets/images/team1.jpg";
import team2 from "assets/images/team2.jpeg";
import team3 from "assets/images/team3.jpeg";
import team4 from "assets/images/team4.jpeg";
import team5 from "assets/images/team5.png";
import team6 from "assets/images/team6.jpg";
import team7 from "assets/images/team7.jpg";

function Team() {
  const imgCard = {
    width: "100%",
    borderRadius: 10,
  };

  return (
    <MKBox
      component="section"
      backgroundColor="success"
      position="relative"
      py={6}
      px={{
        xs: 2,
        lg: 0,
      }}
      mx={-2}
    >
      <Container>
        <Grid container>
          <Grid
            item
            xs={12}
            md={0}
            sx={{
              mb: 12,
            }}
          >
            <MKTypography
              variant="h2"
              color="dark"
              sx={{
                textAlign: "center",
                mb: 3,
              }}
            >
              CONVENIOS Y COLABORACIÓN{" "}
            </MKTypography>{" "}
            <MKTypography
              variant="body1"
              color="dark"
              opacity={0.8}
              sx={{
                textAlign: "center",
              }}
            >
              Actualmente, contamos con los siguientes convenios con empresas y
              organizaciones de caracter público y privado.{" "}
            </MKTypography>{" "}
            <MKTypography
              variant="body2"
              color="dark"
              opacity={0.8}
              sx={{
                textAlign: "center",
              }}
            >
              Para nuestros socios, contamos también con beneficios exclusivos
              bajo convenio.{" "}
            </MKTypography>{" "}
          </Grid>{" "}
        </Grid>{" "}
        <Grid container spacing={2}>
          <Grid item xs={12} sm={8} md={6} lg={4}>
            <MKBox mb={5}>
              <Card>
                <CardMedia
                  component="img"
                  height="250"
                  image={team1}
                  alt="MC. CARLOS FELIX CONTRERAS"
                />
                <CardHeader
                  align="center"
                  title={
                    <Typography
                      variant="h3"
                      color="textSecondary"
                      align="center"
                      component="p"
                    >
                      MC.Carlos Feliz Contreras{" "}
                    </Typography>
                  }
                  subheader={
                    <Typography variant="h5" color="blue" component="p" mx={1}>
                      Nutriólogo{" "}
                    </Typography>
                  }
                />{" "}
                <CardContent>
                  <Typography
                    variant="h5"
                    color="textSecondary"
                    component="p"
                    my={2}
                  >
                    <Icon> call </Icon> (618) 1-27-66-37{" "}
                  </Typography>{" "}
                  <Typography variant="h5" color="textSecondary" component="p">
                    <Icon> location_on </Icon> Las Palmas 218, Fracc. Los
                    Álamos., Durango, Mexico{" "}
                  </Typography>{" "}
                </CardContent>{" "}
                <CardActions>
                  {" "}
                  {/* <Button size="small" href="/" target="_blank"><PublicIcon />{" "}  Ir a sitio web</Button>{" "} */}{" "}
                </CardActions>{" "}
              </Card>{" "}
            </MKBox>{" "}
          </Grid>{" "}
          <Grid item xs={12} sm={8} md={6} lg={4}>
            <MKBox mb={5}>
              <Card content="center">
                <CardMedia
                  component="img"
                  height="250"
                  image={team2}
                  alt="MC ILIANA BUSTAMANTE"
                />
                <CardHeader
                  align="center"
                  title={
                    <Typography
                      variant="h3"
                      color="textSecondary"
                      align="center"
                      component="p"
                      mx={1}
                    >
                      MC.Liliana Bustamante{" "}
                    </Typography>
                  }
                  subheader={
                    <Typography variant="h5" color="blue" component="p" mx={1}>
                      Psicóloga y docente{" "}
                    </Typography>
                  }
                />{" "}
                <CardContent>
                  <Typography
                    variant="h5"
                    color="textSecondary"
                    component="p"
                    my={2}
                  >
                    <Icon> call </Icon> (618) 8-23-14-60{" "}
                  </Typography>{" "}
                  <Typography variant="h5" color="textSecondary" component="p">
                    <Icon> location_on </Icon> Las Palmas 218, Fracc. Los
                    Álamos., Durango, Mexico{" "}
                  </Typography>{" "}
                </CardContent>{" "}
                <CardActions>
                  {" "}
                  {/* <Button size="small" href="/" target="_blank"><PublicIcon />{" "}  Ir a sitio web</Button>{" "} */}{" "}
                </CardActions>{" "}
              </Card>{" "}
            </MKBox>{" "}
          </Grid>{" "}
          <Grid item xs={12} sm={10} md={10} lg={4}>
            <MKBox mb={5}>
              <Card>
                <CardMedia
                  component="img"
                  height="225"
                  image={team3}
                  alt="UNIVERSO ÓPTICO"
                />
                <CardHeader
                  align="center"
                  title={
                    <Typography
                      variant="h4"
                      color="textSecondary"
                      component="p"
                      mx={1}
                    >
                      UNIVERSO ÓPTICO{" "}
                    </Typography>
                  }
                  subheader={
                    <Typography variant="h5" color="blue" component="p" mx={1}>
                      Optometrista{" "}
                    </Typography>
                  }
                />
                <CardContent>
                  <Typography
                    variant="h5"
                    color="textSecondary"
                    component="p"
                    my={2}
                  >
                    <Icon> call </Icon> (618) 817-7710{" "}
                  </Typography>{" "}
                  <Typography variant="h5" color="textSecondary" component="p">
                    <a href="https://goo.gl/maps/qP7hu8m9uY8kfsGC7">
                      <Icon> location_on </Icon> Av. 20 de Noviembre 403, Zona
                      Centro, 34000 Durango, Dgo.{" "}
                    </a>{" "}
                  </Typography>{" "}
                </CardContent>{" "}
                <CardActions>
                  <Button
                    size="small"
                    href="https://www.facebook.com/UniversoOpticoDurango/"
                    target="_blank"
                  >
                    {" "}
                    <PublicIcon /> Ir a sitio web{" "}
                  </Button>{" "}
                </CardActions>{" "}
              </Card>{" "}
            </MKBox>{" "}
          </Grid>{" "}
          <Grid item xs={12} sm={10} md={10} lg={4}>
            <MKBox mb={5}>
              <Card>
                <CardMedia
                  component="img"
                  height="250"
                  image={team4}
                  alt="UNIVERSO ÓPTICO"
                />
                <CardHeader
                  align="center"
                  title={
                    <Typography
                      variant="h4"
                      color="textSecondary"
                      component="p"
                      mx={1}
                    >
                      CLINICA SANTA ELENA{" "}
                    </Typography>
                  }
                  subheader={
                    <Typography variant="h5" color="blue" component="p" mx={1}>
                      Servicios hospitalarios{" "}
                    </Typography>
                  }
                />
                <CardContent>
                  <Typography
                    variant="h5"
                    color="textSecondary"
                    component="p"
                    my={2}
                  >
                    <a href="tel:6188133031">
                    <Icon> call </Icon> (618) 813 3031{" "}
                    </a>
                  </Typography>{" "}
                  <Typography variant="h5" color="textSecondary" component="p">
                    <a href="https://goo.gl/maps/8CzJpajQvcEr9KTJ8">
                      <Icon> location_on </Icon>Enrique Carrola Antuna 711, Durango, Mexico{" "}
                    </a>{" "}
                  </Typography>{" "}
                </CardContent>{" "}
                <CardActions>
                  <Button
                    size="small"
                    href="https://www.facebook.com/pages/Clinica%20Santa%20Elena/114820925370193/"
                    target="_blank"
                  >
                    {" "}
                    <PublicIcon /> Ir a sitio web{" "}
                  </Button>{" "}
                </CardActions>{" "}
              </Card>{" "}
            </MKBox>{" "}
          </Grid>{" "}
          <Grid item xs={12} sm={10} md={10} lg={12}>
            <MKBox mb={5}>
              <Card>
                <CardHeader
                  avatar={
                    <img
                      src={team4}
                      alt="Descripción de la imagen"
                      height="100"
                      style={imgCard}
                    />
                  }
                  title={
                    <Typography
                      variant="h4"
                      color="textSecondary"
                      component="p"
                    >
                      CLINICA SANTA ELENA{" "}
                    </Typography>
                  }
                  subheader={
                    <Typography variant="h5" color="blue" component="p">
                      Servicios hospitalarios{" "}
                    </Typography>
                  }
                />
                <CardContent>
                  <Typography variant="h5" color="textSecondary" component="p">
                    Tel: 618 813 3031{" "}
                  </Typography>{" "}
                  <Typography variant="h5" color="textSecondary" component="p">
                    Dirección: Enrique Carrola Antuna 711, Durango, Mexico{" "}
                  </Typography>{" "}
                  <Typography variant="h5" color="textSecondary" component="p">
                    Beneficios:{" "}
                  </Typography>{" "}
                  <ul>
                    <li>
                      <Typography
                        variant="h6"
                        color="textSecondary"
                        component="p"
                      >
                        Trato preferencial para pacientes de SMELS, 10 % de
                        descuento en consultas de medicina general{" "}
                      </Typography>{" "}
                    </li>{" "}
                    <li>
                      <Typography
                        variant="h6"
                        color="textSecondary"
                        component="p"
                      >
                        Paquetes quirúrgicos{" "}
                      </Typography>{" "}
                    </li>{" "}
                    <li>
                      <Typography
                        variant="h6"
                        color="textSecondary"
                        component="p"
                      >
                        Rayos x{" "}
                      </Typography>{" "}
                    </li>{" "}
                  </ul>{" "}
                </CardContent>{" "}
                <CardActions>
                  <Button size="small"> Ir a úbicación </Button>{" "}
                  <Button
                    size="small"
                    href="https://www.facebook.com/clinicasantaelenadgo/"
                    target="_blank"
                  >
                    {" "}
                    Ir a sitio web{" "}
                  </Button>{" "}
                </CardActions>{" "}
              </Card>{" "}
            </MKBox>{" "}
          </Grid>{" "}
          <Grid item xs={12} lg={6}>
            <MKBox
              mb={{
                xs: 1,
                lg: 0,
              }}
            >
              <HorizontalTeamCard
                image={team5}
                name="LABORATORIOS RIVERA"
                position={{
                  color: "info",
                  label: "Laboratorio de estudios clínicos",
                }}
                description="Tel: (618) 4-54-02-35"
              />
            </MKBox>{" "}
          </Grid>{" "}
          <Grid item xs={12} lg={6}>
            <MKBox
              mb={{
                xs: 1,
                lg: 0,
              }}
            >
              <HorizontalTeamCard
                image={team6}
                name="CENTRO H&T"
                position={{
                  color: "info",
                  label: "Centro de ultrasonido y diagnóstico",
                }}
                description="Tel: (618) 1-44-27-38"
              />
            </MKBox>{" "}
          </Grid>{" "}
          <Grid item xs={12} lg={6}>
            <MKBox
              mb={{
                xs: 1,
                lg: 0,
              }}
            >
              <HorizontalTeamCard
                image={team7}
                name="DENTAREA"
                position={{
                  color: "info",
                  label: "Clínica dental",
                }}
                description="Tel: (618) 8-11-34-16"
              />
            </MKBox>{" "}
          </Grid>{" "}
        </Grid>{" "}
      </Container>{" "}
    </MKBox>
  );
}

export default Team;
